import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Periods from './components/Periods/Periods'
import Leagues from './components/Leagues/Leagues';
import Teams from './components/Teams/Teams';
import TeamSchedule from './components/Teams/TeamSchedule/TeamSchedule';
import LeagueSchedule from './components/Leagues/LeagueSchedule/LeagueSchedule';
import state from './state';


import leaguesData from './data/league';
import leagueTeamsData from './data/TeamssOfLeague149';
import leagueScheduleData from './data/EventsOfLeague177';
import teamScheduleData from './data/EventsOfTeam2618';

import { BrowserRouter, Route } from 'react-router-dom';


const SECTIONS = [
    { title: 'Список лиг', href: '/leagues'},
    { title: 'Расписание лиги' ,  href: '/leagueSchedule'  },
    { title: 'Команды',  href: '/teams' },
    { title: 'Расписание команды',  href: '/teamSchedule' },
  ];



const App = (props ) => { 
console.log(props.state);
    return(
      <BrowserRouter>    
        <div className="app-wrapper">
          <Header/> 
          <Navbar period={props.state.period} sections={SECTIONS}/> 
          <Periods period={props.state.period} setPeriod={props.setPeriod}/>
          <div className="app-wrapper-content">

              <Route path='/leagues' render={ () => <Leagues Data={leaguesData} period={props.state.period}/> }/>
              <Route path='/leagueSchedule/:leag_id/per:id' render={ () => <LeagueSchedule Data={leagueScheduleData}/>}/>
              <Route path='/teams/:team_id/per:id' render={ () => <Teams Data={leagueTeamsData}/>}/>
              <Route path='/teamSchedule/:team_id/per:id' render={ () => <TeamSchedule Data={teamScheduleData}/>}/>
          </div>
        </div>
      </BrowserRouter>  
    );//return  

}//class

export default App;
